import React, { useState } from "react";
import { Link } from "react-router-dom";
import Swal from "sweetalert2";
function AddEvent()
{
  const[name,SetName]=useState('');
  const[title,settitle]=useState('');
  const[speaker,setspeaker]=useState('');
  const[description,Setdescription]=useState('');
  const[date,Setdate]=useState('');
  const[day,setday]=useState('');
  const[time,Settime]=useState('');
  const[venue,setvenue ]=useState('');
  const[image,setimage]=useState('');
  

  const AddEvent=()=>{
    if (name=="")
        {
            Swal.fire({
                title: "Validation Message",
                text: "name Field is Required*",
                icon: "wrong"
              });   
        }
        else if (title=="")
        {
            Swal.fire({
                title: "Validation Message",
                text: "title Field is Required*",
                icon: "wrong"
              });   
        }
        else if (speaker=="")
        {
            Swal.fire({
                title: "Validation Message",
                text: "speaker Field is Required*",
                icon: "wrong"
              });   
        }
        else if (description=="")
        {
            Swal.fire({
                title: "Validation Message",
                text: "description Field is Required*",
                icon: "wrong"
              });   
        }
        else if (date=="")
        {
            Swal.fire({
                title: "Validation Message",
                text: "Dtae Field is Required*",
                icon: "wrong"
              });   
        }
        else if (day=="")
        {
            Swal.fire({
                title: "Validation Message",
                text: "Day Field is Required*",
                icon: "wrong"
              });   
        }
        else if (time=="")
        {
            Swal.fire({
                title: "Validation Message",
                text: "Time Field is Required*",
                icon: "wrong"
              });   
        }
        else if (venue=="")
        {
            Swal.fire({
                title: "Validation Message",
                text: "Venue Field is Required*",
                icon: "wrong"
              });   
        }
        else if (image=="")
        {
            Swal.fire({
                title: "Validation Message",
                text: "Image Field is Required*",
                icon: "wrong"
              });   
        }
        else{
            axios.post('http://localhost:4000/shedule',{name,title,speaker,description})
            Swal.fire({
                title: "Validation Message",
                text: "Shedule Registered",
                icon: "wrong"
              }); 
        }
    }
    return(
        <div>
                    <div>
<nav class="main-header navbar navbar-expand navbar-white navbar-light">

<ul class="navbar-nav">
  <li class="nav-item">
    <a class="nav-link" data-widget="pushmenu" href="#" role="button"><i class="fas fa-bars"></i></a>
  </li>
 
  <li class="nav-item d-none d-sm-inline-block">
    <Link to="/exhibitordashboard" class="nav-link">My Profile</Link>
  </li>
  <li class="nav-item d-none d-sm-inline-block">
    <Link to="/addevent" class="nav-link">Add Events</Link>
  </li>
  <li class="nav-item d-none d-sm-inline-block">
    <Link to="/eventrequesttoadmin" class="nav-link">Request For Events</Link>
  </li>
  <li class="nav-item d-none d-sm-inline-block">
    <Link to="/exhibitoreventstatus" class="nav-link">MyEvents</Link>
  </li>
  <li class="nav-item d-none d-sm-inline-block">
    <Link to="/exhibitorticketstatus" class="nav-link">Tickets Status</Link>
  </li>
  <li class="nav-item d-none d-sm-inline-block">
    <Link to="/talkwithadmin" class="nav-link">Communicate With Admin</Link>
  </li>
</ul>




</nav>



<aside class="main-sidebar sidebar-dark-primary elevation-4">

  <a href="index3.html" class="brand-link">
 
  <span class="brand-text font-weight-light text-center">Event Sphere</span>
</a>


<div class="sidebar">

  <nav class="mt-2">
    <ul class="nav nav-pills nav-sidebar flex-column" data-widget="treeview" role="menu" data-accordion="false">
     
      <li class="nav-item has-treeview menu-open">
        <Link to="/exhibitordashboard" class="nav-link ">
          <i class="nav-icon fas fa-tachometer-alt"></i>
          <p className="text-light">
       My Profile
            <i class="right fas fa-angle-left"></i>
          </p>
        </Link>
        </li>
        <li class="nav-item has-treeview menu-open">
        <Link to="/addevent" class="nav-link ">
          <i class="nav-icon fas fa-tachometer-alt"></i>
          <p className="text-light">
       Add Events
            <i class="right fas fa-angle-left"></i>
          </p>
        </Link>
        </li>
        
        <li class="nav-item has-treeview menu-open">
        <Link to="/eventrequesttoadmin" class="nav-link ">
          <i class="nav-icon fas fa-tachometer-alt"></i>
          <p className="text-light">
      Request For Events
            <i class="right fas fa-angle-left"></i>
          </p>
        </Link>
        <Link to="/exhibitoreventstatus" class="nav-link ">
          <i class="nav-icon fas fa-tachometer-alt"></i>
          <p className="text-light">
      My Events
            <i class="right fas fa-angle-left"></i>
          </p>
        </Link>
        <Link to="/exhibitorticketstatus" class="nav-link ">
          <i class="nav-icon fas fa-tachometer-alt"></i>
          <p className="text-light">
       Tickets Status
            <i class="right fas fa-angle-left"></i>
          </p>
        </Link>
   
        </li>
        <li class="nav-item has-treeview menu-open">
        <Link to="/talkwithadmin" class="nav-link ">
          <i class="nav-icon fas fa-tachometer-alt"></i>
          <p className="text-light">
       Communicate With Admin
            <i class="right fas fa-angle-left"></i>
          </p>
        </Link>
        </li>
</ul>
        </nav>
   
     
   
    
      
 
  



</div>

</aside>
    {/* Work Start */}
    <div class="content-wrapper">
  
  <div class="content-header">


    <div class="container-fluid">
    <form id="addeventform">
        <h1>Add Event</h1>
        <br></br>
        
    <div data-mdb-input-init class="form-outline mb-4">
    <input type="text" id="form4Example1" value={name} onChange={ (e) => SetName(e.target.value) } class="form-control" placeholder="Exhibitor Name"/>
  </div>
    <div data-mdb-input-init class="form-outline mb-4">
    <input type="text" id="form4Example1" value={title} onChange={ (e) => settitle(e.target.value) } class="form-control" placeholder="Event Title"/>
  </div>
  <div data-mdb-input-init class="form-outline mb-4">
    <input type="text" id="form4Example1"  value={speaker} class="form-control" onChange={ (e) => setspeaker(e.target.value) } placeholder="Event Speaker"/>
  </div>
  <div data-mdb-input-init class="form-outline mb-4">
    <textarea class="form-control" id="form4Example3"  value={description} rows="4" onChange={ (e) => Setdescription(e.target.value) } placeholder="Event Description"></textarea>
  </div>  
<div data-mdb-input-init class="form-outline mb-4">
<label class="form-label" for="customFile">Select Date That Best Suites For The Events</label>
<select class="form-control"  value={date} onChange={ (e) => Setdate(e.target.value) } aria-label="Default select example">
  <option disabled>Select Date</option>
  <option value="1">One</option>
  <option value="2">Two</option>
  <option value="3">Three</option>
</select>
</div>
<div data-mdb-input-init class="form-outline mb-4">
<label class="form-label" for="customFile">Select Day That Best Suites For The Events</label>
<select class="form-control"  value={day} onChange={ (e) => setday(e.target.value) } aria-label="Default select example">
  <option disabled>Select Day</option>
  <option value="1">One</option>
  <option value="2">Two</option>
  <option value="3">Three</option>
</select>
</div>
<div data-mdb-input-init class="form-outline mb-4">
<label class="form-label" for="customFile">Select Time That Best Suites For The Events</label>
<select class="form-control"  value={time} onChange={ (e) => Settime(e.target.value) } aria-label="Default select example">
  <option disabled>Select Time</option>
  <option value="1">One</option>
  <option value="2">Two</option>
  <option value="3">Three</option>
</select>
</div>
<div data-mdb-input-init class="form-outline mb-4">
<label class="form-label" for="customFile">Select Venue That Best Suites For The Events</label>
<select class="form-control" value={venue} onChange={ (e) => setvenue(e.target.value) } aria-label="Default select example">
  <option disabled>Select Venue</option>
  <option value="1">One</option>
  <option value="2">Two</option>
  <option value="3">Three</option>
</select>
</div>
<div data-mdb-input-init class="form-outline mb-4">
  <label class="form-label"  for="customFile">Upload An Image</label>
<input type="file" accept="image/*"  value={image}  onChange={ (e) => setimage(e.target.files[0]) } class="form-control" id="customFile"/>
</div>
<div data-mdb-input-init class="form-outline mb-4">
<button type="button" onClick={AddEvent} class="btn btn-primary">Add Event</button>
</div>
    </form>

    </div>   
    </div>
</div>


 {/* Work end */}

</div>
        </div>
    )
}
export default AddEvent
